import React, { Component } from 'react'
import { BrowserRouter as Router, Route } from 'react-router-dom';
import SignupForm from '../containers/SignupForm'
import LoginForm from '../containers/LoginForm'
import NewPostForm from '../containers/NewPostForm'
import Timeline from './Timeline'
import Navbar from '../components/Navbar'

// signup={signup} 
// login={login} 
// loggedIn={loggedIn} 
// loggedInAs={loggedInAs} 
// posts={posts} 
// onSignUp={this.signUp}
// onLogin={this.login}
// onLoggedIn={this.loggedIn}
// onSetCurrentUser={this.setCurrentUser}

export class Home extends Component {
    render() {
        let { signup, login, loggedIn, loggedInAs, posts, onSignUp, onLogin, onLoggedIn, onSetCurrentUser } = this.props
        return (
            <div>
                HELLO, YOU ARE AT HOME PAGE<br />
                <Router>
                    <Navbar onSignUp={this.signUp} onLogin={login} loggedIn={loggedIn} />
                    <Route exact path="/signup" render={() => <SignupForm onSetCurrentUser={onSetCurrentUser} onSignUp={onSignUp} onLoggedIn={onLoggedIn} signup={signup} />} />
                    <Route exact path="/login" render={() => <LoginForm onSetCurrentUser={onSetCurrentUser} onLoggedIn={onLoggedIn} login={login} onLogin={onLogin} />} />
                    <Route exact path="/post/new" render={() => <NewPostForm />} />
                    <Route exact path="/timeline" render={() => <Timeline posts={posts} />} />
                </Router>
            </div>
        )
    }
}

export default Home
